import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a "Your Profile" link to be visible (there are multiple, pick the first visible one)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click_profile.png'));

    // Click the first "Your Profile" link
    await profileLink.click();

    // Wait for Jun's profile content to appear (look for Jun's name or username)
    // Try to find Jun's full name or username in the DOM
    let junSelector = null;
    try {
      junSelector = await page.waitForSelector('text=Jun Kim', { timeout: 5000 });
    } catch {
      // Try username as fallback
      junSelector = await page.waitForSelector('text=@jun', { timeout: 5000 });
    }

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_jun_profile.png'));

    // Extract Jun's profile name and username for verification
    const junName = await page.$eval('h2', el => el.textContent.trim());
    let junUsername = '';
    try {
      junUsername = await page.$eval('.username', el => el.textContent.trim());
    } catch {
      junUsername = '';
    }

    return {
      success: true,
      action: "Navigated to Jun's Profile page via 'Your Profile' link",
      extractedData: {
        junName,
        junUsername
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
